  true,\n\t\"url\": null,\n\t\"notes\": \"<p>These data files contain the highest
  level of cost report status for cost reports in all reported fiscal years.  For
  example, if the Healthcare Cost Report Information System (HCRIS) department has
  both an as submitted report and a final settled report for a hospital for a particular
  year, the data files will only contain the final settled report. If HCRIS has both
  a final settled report and a reopened report, the data files will only have the
  reopened report.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
